import React from "react";
import { Route, Redirect } from "react-router-dom";

export const MyRoute = ({ component: Component, onLoging }) => (
  <Route
    {...rest}
    render={props =>
      localStorage.getItem("currentUser") ? (
        <Component {...props} />
      ) : (
        <Redirect
          to={{ pathname: "/login", state: { from: props.location } }}
        />
      )
    }
  />
);
